import User from './User';

function Users() {
    const users = [
        {id:1,name:"akash"},
        {id:2,name:"koushik"},
        {id:3,name:"radika"}
    ];
  return (
    <div>
        {users.map((user)=>{
            <>
            <h1>{user.id}</h1>
            <p>{user.name}</p>
            </>
        })}
    </div>
  )
}

export default Users
